import rectangle from '../../img/rectangle-7-11.png';
import rectanglePanel from '../../img/rectangle-9.svg';
import polygon3 from '../../img/polygon-3.svg';
import likeButton from '../../img/icon-3.svg';
import checkButton from '../../img/vector-81.svg';

export default function Locations() {
    return (
        <div className="flex flex-col items-start gap-3 w-full">
            <div className="font-semibold text-sm text-[#7a7a7a]">
                800sqft with View
            </div>
            <div className="flex flex-col items-center gap-4 w-full">
                <PropertyListing />
                <LoadmoreButton />
            </div>
        </div>
    );
}

function PropertyListing({
    propertyName = 'Property name',
    address = '3806 W 20th Ave, Kennewick, WA 99338',
    suggestedRentValue = 1234,
    rent = 123,
    floorNumber = 10,
    stories = 6,
    avgUnitSize = '741 SF',
    views = 20,
    showings = 20,
    date = '12.12.2024',
    parking = '-',
    type = 'Apartments - All',
    distance = '-'
}) {
    return (
        <div className="relative w-full h-[186px] flex items-center">
            <img className="absolute w-[798px] h-full" alt="Rectangle" src={rectanglePanel} />
            <img className="absolute w-[343px] h-full object-cover" alt="Rectangle" src={rectangle} />
            <div className="absolute w-[21px] h-[59px] top-0 left-[324px] bg-[#ff914d] rounded-bl-md text-white text-xs font-bold flex items-center justify-center rotate-90">
                Active Listing
            </div>
            <div className="absolute top-[7px] left-[3px] bg-white rounded border border-[#00000042] shadow">
                <img className="w-[11px] h-[9px]" alt="Check" src={checkButton} />
            </div>
            <div className="absolute top-0 left-[372px] w-[464px] h-[157px]">
                <p className="text-xs text-[#2a2a33]">{propertyName} <span className="text-sm font-semibold">{address}</span></p>
                <p className="text-xs text-[#918f8f]">{avgUnitSize}</p>
                <div className="flex flex-wrap gap-4 text-xs text-[#918f8f]">
                    {[
                        { val: `$${suggestedRentValue}`, label: 'Suggested Rent' },
                        { val: `$${rent}`, label: 'Rent' },
                        { val: floorNumber, label: 'Floor Number' },
                        { val: stories, label: 'Stories' },
                        { val: avgUnitSize, label: 'Avg. Unit Size' },
                        { val: views, label: 'No. Viewed' },
                        { val: showings, label: 'No. Showings' },
                        { val: date, label: 'Lease Expiry' },
                        { val: parking, label: 'Parking' },
                        { val: type, label: 'Type' },
                        { val: distance, label: 'Distance to Transit' }
                    ].map(({ val, label }, idx) => (
                        <div key={idx} className="flex flex-col w-1/4">
                            <ValuesBold val={val} />
                            <Values val={label} />
                        </div>
                    ))}
                </div>
            </div>
            <img className="absolute w-[15px] h-[13px] top-16 left-[843px]" alt="Polygon" src={polygon3} />
        </div>
    );
}

function LoadmoreButton() {
    return (
        <div className="w-[124px] h-[47px] bg-black rounded-[23.5px] flex items-center justify-center text-xs text-white font-semibold">
            Load More
        </div>
    );
}

function ValuesBold({ val }) {
    return (
        <div className="font-bold text-black text-xs">
            {val}
        </div>
    );
}

function Values({ val }) {
    return (
        <div className="text-[#918f8f] text-[10px]">
            {val}
        </div>
    );
}
